<!DOCTYPE html>
<html>
<title>W3.CSS</title>
<meta name="viewport" content="width=device-width, initial-scale=1">
<link rel="stylesheet" type="text/css" href="../../../../SetupLibStyle.css">
<style>
.mySlides {display:none;}
</style>
<body>

<p class="trendslideshowheader">AU London session breakout M1 to M15 into the void no news</p>

<div class="w3-content w3-display-container">
  <img class="mySlides" src="https://plaghub.github.io/planotes.github.io/0Trending/Continuation/Breakout/IntoTheVoid/20200602_AU_M1_LondonOpenNoNews.JPG" style="width:100%">
  <img class="mySlides" src="https://plaghub.github.io/planotes.github.io/0Trending/Continuation/Breakout/IntoTheVoid/20200602_AU_M5_LondonOpenNoNews.JPG" style="width:100%">
  <img class="mySlides" src="https://plaghub.github.io/planotes.github.io/0Trending/Continuation/Breakout/IntoTheVoid/20200602_AU_M15_LondonOpenNoNews.JPG" style="width:100%">

  <button class="w3-button w3-black w3-display-left" onclick="plusDivs(-1)">&#10094;</button>
  <button class="w3-button w3-black w3-display-right" onclick="plusDivs(1)">&#10095;</button>
</div>

<script>
var slideIndex = 1;
showDivs(slideIndex);

function plusDivs(n) {
  showDivs(slideIndex += n);
}

function showDivs(n) {
  var i;
  var x = document.getElementsByClassName("mySlides");
  if (n > x.length) {slideIndex = 1}
  if (n < 1) {slideIndex = x.length}
  for (i = 0; i < x.length; i++) {
    x[i].style.display = "none";  
  }
  x[slideIndex-1].style.display = "block";  
}
</script>

</body>
</html>
